●伸縮性のDRYtech素材を使用した丈夫なアルパイン用ハードシェル ジャケット。<br>●機能的なフード、バックパックに対応したポケット位置、そして実用的な細部は、様々なアクティビティに最適です。<br>●調節可能なヘム幅<br>●ドローコード ヘム、片手で調節可能<br>●横縦の調節可能なヘルメット対応フード<br>●若干伸縮性があり、耐水圧20,000 mmのDRYtech Premium素材<br>●防滴ツーウェイ ジッパーによる脇下のベンチレーション<br>●ベルクロ クロージャー付きのプレシェイプ スリーブ<br>●防滴ツーウェイ フロントジッパー<br>●リュックサックとクライミング用ハーネス対応のジッパー付きポケット2つ<br>●ジッパー付の弾性メッシュのポケット1つとケーブル アウトレット付きのマルチメディア用ポケット1つ<br>●ジッパー付き内ポケット1つ<br>●カット：レギュラーフィット<br>●重量 [g]：470<br>●DRYtech Premium 3-Layer, 50x75DEN<br>
