★ノースフェイスのジャケット！<br>
<br>
●アウトドア用防水ハードシェルの定番ドットショット！<br>
●素材には軽量なハイベント2.5層を採用しており、非常に軽量かつしなやかな着心地が特徴。<br>
●冷気を遮断しながら、高い防水透湿性も確保するスペックは、日帰り低山や富士山、また高原キャンプでの天候や気温の急変にも対応可能！<br>
●両胸にジッパーポケット付き。<br>
●フード、裾にはドローコード付きでフィット感の調整が可能！<br>
